%[text] %[text:anchor:T_8CA6625A] # Simulate a light field camera based on a microlens array 
%[text] We explain the idea of a light field camera built by placing a microlens array in front of the image sensor. In that case, the pixels behind each microlens code the rays that arrive from different locations within the lens.
%[text] ZL, BW SCIEN 2018
%[text] **Dependencies**: ISET3d, ISETCam, ISETLens
%[text] **See also:** 
%[text]      t\_piIntro\_\*, tls\_camera\*, s\_sensorDPAF (ISETCam)
%[text:tableOfContents]{"heading":"**Table of Contents**"}
%[text] %[text:anchor:H_99D6CC2B] ## Initialize ISETCam, Docker and ISETLens, ISET3d
ieInit;
if ~piDockerExists, piDockerConfig; end
if isempty(which('lensC'))
    error('You must add the isetlens repository to your path');
end

% Some scratch files are written, so we change here to keep them out of the
% repository -- NB Probably on old way to accomplish this
if ~isfolder(fullfile(piRootPath, 'local'))
    mkdir(fullfile(piRootPath, 'local'))
end
chdir(fullfile(piRootPath,'local'));
%%
%[text] %[text:anchor:H_76BB5889] ## Read the pbrt files
%[text] %[text:anchor:H_FF5E18B2] Read the default chess set scene.  Later we are going to focus at a plane about 0.6 m from the camera
thisR = piRecipeDefault('scene name','chessset');
scene = piWRS(thisR); %[output:7bf318f5] %[output:194b03e1]
%%
%[text] %[text:anchor:H_89359EF3] ## Choose the imaging lens
%[text] This double gauss lenses has a 22 deg field of view.  It works well with the chess set scene.  The focal length is a little shorter than expressed in the file name.
imagingLens     = lensC('filename','dgauss.22deg.12.5mm.json');
imagingLens.draw; %[output:838c62d8]
fprintf('Focal length =  %.3f (mm)\nHeight = %.3f\n',... %[output:group:806384fe] %[output:2ad96804]
    imagingLens.focalLength,imagingLens.get('lens height')); %[output:group:806384fe] %[output:2ad96804]
%%
%[text] %[text:anchor:H_7079E023] ## Read in the microlens and set its size
%[text] We will array up the microlenses.  They are positioned to be adjacent to one another.  We set the size of each microlens so handle the number of pixels we will have behind the lens.  In this case, we make the microlens size to be 12 microns.
mlensFile = fullfile(piDirGet('lens'), 'microlens.json');
microlens = lensC('filename',mlensFile);
microlens.draw; %[output:2054b7a3]
mLensSize = 0.012;                       % mm
microlens.adjustSize(mLensSize);
fprintf('Focal length =  %.3f (mm)\nHeight = %.3f (mm)F-number %.3f\n',... %[output:group:78bb79e4] %[output:61c7946e]
    microlens.focalLength,microlens.get('lens height'), microlens.focalLength/microlens.get('lens height')); %[output:group:78bb79e4] %[output:61c7946e]
%%
%[text] %[text:anchor:H_2327108E] ## Set up the microlens array and film size
%[text] The number of microlenses (nMicrolens) is the number of image samples in the reconstructed images. We always choose an even number microlensese, which assures that the sensor and ip data have the right integer relationships in the subsequent calculation. 
%[text] The sensor size (film size) should be big enough to support all of the microlenses.
%[text] There are a lot of pixels (photosites), but fewer microlenses.  The number of microlenses determines the effective spatial resolution.
nMicrolens = [40 40]*4;   % Appears to work for rectangular case, too
filmheight = nMicrolens(1)*microlens.get('lens height');
filmwidth  = nMicrolens(2)*microlens.get('lens height');

% The pixel size a is determined by the other factors
pixelsPerMicrolens = 5;  % The 2D array of pixels is this number squared
pixelSize  = microlens.get('lens height')/pixelsPerMicrolens;   % mm

% The number of photosites on the sensor (film)
filmresolution = [filmheight, filmwidth]/pixelSize;
%%
%[text] %[text:anchor:H_45DBA29C] ## Building the lens file 
%[text] The optics includes the imaging lens and the microlens array.  This is specified by  a big json file that is assembled using a special tool that is part of the PBRT Docker container.
[~,imagingLensName,~] = fileparts(imagingLens.name);
[~,microLensName,e]   = fileparts(microlens.name);
combinedName = sprintf('%s+%s',imagingLensName,microLensName);
lensdir = fullfile(thisR.get('output dir'),'lens');
lensFile = fullfile(lensdir,combinedName);
if ~exist(lensdir,'dir'),mkdir(lensdir);end
lensFile = [lensFile,'.json'];

[combinedlens, info] = piMicrolensInsert(microlens,imagingLens,... %[output:group:8e21cc73] %[output:165b8b63]
    'n microlens',nMicrolens,'output name',lensFile); %[output:group:8e21cc73] %[output:165b8b63]
%[text] This is the geometric arrangement
LFMicrolensGeometry(pixelSize,mLensSize); %[output:0c9aa63b]
%[text] 
%%
%[text] %[text:anchor:H_AC1F9C9B] ## Create the camera with the combined imaging lens and microlens
%[text] In this part of the code we start to use the ISET3d rendering methods.
fprintf('Using lens: %s\n',combinedlens); %[output:031adb1c]
thisR.camera = piCameraCreate('omni','lensFile',combinedlens);

% PBRT estimates the distance.  It is not perfectly aligned to the depth
% map, but it is close.  For the Chess Set we use about 0.6 meters as the
% plane that will be in focus for this imaging lens.  With the lightfield
% camera we can reset the focus, of course.s
thisR.set('focal distance',0.6);

% This is the size of the film/sensor in millimeters
thisR.set('film diagonal',sqrt(filmwidth^2 + filmheight^2));

% Film resolution -
thisR.set('film resolution',filmresolution);

% We can use bdpt if you are using the docker with the "test" tag (see
% header). Otherwise you must use 'path'
thisR.set('integrator subtype','path');

% This is the aperture of the imaging lens of the camera in mm
thisR.set('aperture diameter',6);   % In millimeters

thisR.summarize('all'); %[output:84d8cb7f]
%%
%[text] %[text:anchor:H_BCA77175] ## Render and then display
oiName = sprintf('%s-%d',thisR.get('input basename'),thisR.get('aperture diameter'));
oi = piWRS(thisR,'name',oiName); %[output:1465b983] %[output:6d8cccb5]
%%
%[text] %[text:anchor:H_3951C20B] ## Create a lightfield structure
%[text] Next, we use Don Dansereau's  *Light Field toolbox* routines (LF\<tab\>) to analyze the data.  Here we work with the optical image data.  Later we will work with the image processed data.
%[text] This routine converts the RGB image to the lightfield format used by the LF library. It does this with knowledge of the number of microlenses. Notice that this library uses x,y rather than row,col.
rgb = oiGet(oi,'rgb');
LF = LFImage2buffer(rgb,nMicrolens(2),nMicrolens(1));
%%
%[text] %[text:anchor:H_8220D5AC] ## Show the sub aperture views
%[text] Once the data are in LF format, we extract corresponding samples from behind each microlens and show the nMicrolens x nMicrolens  samples as separate images.  The LF toolbox calls these 'sub aperture' views.  There are pixelsPerMicrolens x pixelsPerMicrolens images, and each is like looking through the imaging lens from slightly different points of view.  Also, notice how we don't get a very good view based on the photons at the corner samples.
[imgArray, imgCorners] = LFbuffer2SubApertureViews(LF);
ieNewGraphWin; imagesc(imgArray); axis image; %[output:1c5720a4]
%[text] If you want to see just one of the pictures, you can do this.  Maybe we should write a function for this.  Notice that the corners are returned from the LFbuffer2SubApertureViews() above.
%%
%[text] %[text:anchor:H_54AB897F] ## Convert the OI through a matched sensor
%[text] Next, we go through the image processor.  We create a sensor that has each pixel equal to one sample in the OI.  There is a special *sensorCreate* method that creates a sensor matched to the light field at the optical image.  Each pixel in the sensor samples each point in the optical image.
sensor = sensorCreate('light field',oi);
sensor = sensorCompute(sensor,oi);
sensorWindow(sensor); %[output:89d39fa5]
%%
%[text] %[text:anchor:H_C1F1F7AB] ## Image process ... should really use the whiteScene here
ip = ipCreate;
ip = ipCompute(ip,sensor);
ipWindow(ip); %[output:1f8a0a6c]
%%
%[text] %[text:anchor:H_B04997E6] ## Convert the image processed data into a light field representation
%[text] The lightfield variable, *lightfield*, has the dimensions
%[text]     pixelsPerMicrolens x pixelsPerMicrolens x nMicrolens x nMicrolens x 3
%[text] We use an ISETCam function to convert the image processed data to the lightfield format.  This is a little different from the LFImage2buffer function we used earlier.
lightfield = ip2lightfield(ip,'pinholes',nMicrolens,'colorspace','srgb');
%%
%[text] %[text:anchor:H_073689D7] ## Video of the subaperture views
%[text] You have to copy and past this line into the command prompt.  The video does not play within the LiveScript well.  The command creates a little video that cycles through the different subaperture views. To end the movie, click on the window to select and then press Escape
%[text] Run this code by hand.  It doesn't do well with the LiveScript!
% LFDispVidCirc(lightfield.^(1/2.2));
%%
%[text] %[text:anchor:H_9A0EAC1B] ## Additional ideas for more analyses
%[text] I  found that Don Dansereau posted a recent (May 2020) GitHub update with new features!  (https://github.com/doda42/LFToolbox).  A good project might be to explore using the simulated data with some of the new functionality in Don's toolbox.  One older example - autofocus - is here.  I never made it work, however.
%{
% There are other LF functions to explore for visualizing the data.
  outputImage = LFAutofocus(lightfield);
  ieNewGraphWin;
  imagescRGB(outputImage);
%}
%{
% To adjust the focus for different scenes, use piRender with
% the 'depth map' option.  This lets you see how far away the scene objects
% are.
  dMap = piRender(thisR,'render type','depth');
  ieNewGraphWin; 
  imagesc(dMap); colormap(flipud(gray)); colorbar;
%}
%[text] 

